import React from "react";

import Image from "next/image";

import { PictureContainer } from "./styles";

function ProfilePicture() {
  return (
    <PictureContainer>
      <div
        style={{
          width: 150,
          height: 150,
          position: "relative",
          borderRadius: "100%"
        }}
      >
        <Image
          className="rounded"
          src="/images/lq_1.jpg"
          alt="Long-Quan"
          layout="fill"
          objectFit="cover"
          quality={75}
        />
      </div>
    </PictureContainer>
  );
}

export default ProfilePicture;
